// src/components/Navbar.js
import React from 'react';
import { Link } from 'react-scroll';
import './Navbar.css';

const Navbar = () => {
  return (
    <nav className="navbar">
      <ul className="navbar-links">
        <li>
          <Link
            to="hero"
            smooth={true}
            duration={500}
            spy={true}
            activeClass="active"
            offset={-200} // Increased offset for better detection
            onSetActive={() => console.log('Home is active')}
          >
            Home
          </Link>
        </li>
        <li>
          <Link
            to="bio"
            smooth={true}
            duration={500}
            spy={true}
            activeClass="active"
            offset={-200}
            onSetActive={() => console.log('Bio is active')}
          >
            Bio
          </Link>
        </li>
        <li>
          <Link
            to="experience"
            smooth={true}
            duration={500}
            spy={true}
            activeClass="active"
            offset={-200}
            onSetActive={() => console.log('Experience is active')}
          >
            Experience
          </Link>
        </li>
        <li>
          <Link
            to="projects"
            smooth={true}
            duration={500}
            spy={true}
            activeClass="active"
            offset={-200}
            onSetActive={() => console.log('Projects is active')}
          >
            Projects
          </Link>
        </li>
      </ul>
    </nav>
  );
};

export default Navbar;
